CREATE DEFINER=`root`@`localhost` PROCEDURE `ACT`()
BEGIN
	update algotrade.factdata
    set ACT = 'Buy'
    where dma_50 > dma_200;
    	update algotrade.factdata
    set ACT = 'Sell'
    where dma_50 < dma_200;
	update algotrade.factdata
    set ACT = 'N'
    where dma_50 = dma_200;
    update algotrade.factdata 
	set act = 'N' 
	where act is NULL;
END ;;
