CREATE DEFINER=`root`@`localhost` PROCEDURE `_sp_CleanData`(in Symbol_short varchar(6))
begin
delete from algotrade.positions where symbol = Symbol_short;
delete from algotrade.cash where symbol = Symbol_short;
delete from algotrade.trades where symbol = Symbol_short;

INSERT INTO algotrade.positions  (date, symbol, open_pos, day_trade, close_pos) 
VALUES ((select date_sub(min(date), interval 1 day) from algotrade.factdata where symbol = Symbol_short), Symbol_short, '0', '0', '0'); 
INSERT INTO algotrade.cash (symbol, date, currency, account, open_cash, day_cash, close_cash) 
VALUES (Symbol_short, (select date_sub(min(date), interval 1 day) from algotrade.factdata where symbol = Symbol_short), 'USD', 'ACC', '0', '0', '0');
End ;;
