update algotrade.factdata fd, algotrade.DMA_50 dm 
set fd.DMA_50 = dm.DMA_50 where fd.date = dm.date and fd.symbol = dm.symbol;
update algotrade.factdata fd, algotrade.DMA_200 dm
set fd.DMA_200 = dm.DMA_200 where fd.date = dm.date and fd.symbol = dm.symbol;
end ;;
